
            // 自动加载图片的脚本
            document.addEventListener('DOMContentLoaded', function() {
                const imgSrc = 'data:image/png;base64,';
                
                // 替换所有logo-image类的图像
                const logoImages = document.querySelectorAll('.logo-image');
                logoImages.forEach(img => {
                    if (img.tagName === 'IMG') {
                        img.src = imgSrc;
                    }
                });
                
                // 替换welcome-image类的SVG
                const welcomeCard = document.querySelector('.welcome-card');
                if (welcomeCard) {
                    const svgImage = welcomeCard.querySelector('svg.welcome-image');
                    if (svgImage) {
                        const imgElement = document.createElement('img');
                        imgElement.src = imgSrc;
                        imgElement.className = 'welcome-image';
                        imgElement.alt = 'AI Travel Assistant';
                        svgImage.replaceWith(imgElement);
                    }
                }
            });
            